window.bookSummaryJSON = "<p>I had it so wrong.<br> For three years I had him on his knees, subjugated to my will. All that lethal power mine to command.<br> I thought him tamed.<br> I didn’t know the man who played my captive all those years. I didn’t know what he was truly capable of.<br> Now I’m the one subjugated, dependent on his protection.<br> Hate me as he might, I know he’ll keep me safe. But the price?<br> My heart.<br> <br> <b>NB: This is the third and final of Nora’s Protector serial. Make sure you listen to part 1 - </b><b><i>Protector: Rage</i></b><b> - first.</b></p>"; 
